import "./App.css";
// importing components from react-router-dom package
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";
import Home from "./components/Home";
import About from "./components/About";
import ContactUs from "./components/ContactUs";

function App() {
  return (
      <div>
      <>
        <Router>
          <Routes>
            <Route

                path="/"
                element={<Home />}
            />
            <Route
                path="/about"
                element={<About />}
            />
            <Route
                path="/contactus"
                element={<ContactUs />}
            />
            <Route
                path="*"
                element={<Navigate to="/" /> }
            />
          </Routes>
        </Router>
      </>
      </div>
  );
}

export default App;
